function testBatchCombine(times){
    batch = true;
    var fun = 'buy';
    var args = [];
    var value = 2;
    var f = function(){
        times --;
        var action = getRandomInt(0, 4);
        if(times > 0){
            if(action == 0 || action == 4){
                fun = 'buy';
                args = [];
                value = (Math.random() * (2 - 0.001)+0.001).toFixed(18);
            } else if (action == 1){
                fun = 'sell';
                args = [];
                args.push((Math.random() * (10 - 0.01)+0.01).toFixed(15));
                value = 0;
            } else {
                fun = 'burn';
                args = [];
                args.push((Math.random() * (10 - 0.01)+0.01).toFixed(15));
                value = 0;
            }
            call(fun, args, value, f);
        } else {
            testBuyOrderIndex();
            testSellOrderIndex();
            testBurnOrderIndex();
        }
    };
    call(fun, args, value, f);
}

