function call(fun, args, value, callback){
    console.log('call ' + contract + ' @ ' + fun + ": " +JSON.stringify(args) + ' with value: ' + value);
    innerCall(fun, args, value, function (params) {
        var address = params.from.getAddressString();
        neb.api.call({
            from: address,
            to: params.to,
            value: params.value,
            nonce: params.nonce,
            gasPrice: params.gasPrice,
            gasLimit: params.gasLimit,
            contract: params.contract
        }).then((resp) => {
            console.log(resp);
            if(batch){
                players.push(params.from.getPrivateKeyString());
                callback();
            }
            if(resp.execute_err !== '') return;
            var Transaction = Nebulas.Transaction;
            var tx = new Transaction({
                chainID: chainID,
                from: params.from,
                to: params.to,
                value: params.value,
                nonce: params.nonce,
                gasPrice: params.gasPrice,
                gasLimit: params.gasLimit,
                contract: params.contract
            });
            tx.signTransaction();
            //send a transfer request to the NAS node
            neb.api.sendRawTransaction({
                data: tx.toProtoString()
            }).then((result) => {
                let txhash = result.txhash;
                let trigger = setInterval(() => {
                    try{
                        neb.api.getTransactionReceipt({hash: txhash}).then((receipt) => {
                            console.log('Pending transaction ...');
                            if (receipt.status != 2) //not in pending
                            {
                                console.log(JSON.stringify(receipt));
                                clearInterval(trigger);
                                callback()
                            }
                        });
                    } catch(err){
                        console.log(err);
                        clearInterval(trigger);
                    }
                }, 5000);
            });

        }).catch((err) => {
            console.log('here');
            console.log(err);
        });
    });
}


function innerCall(fun, args, value, callback) {
    let params = {};

    if (!globalParams.account) {
        return;
    }

    //if(usePlayerAccount()){
    //    params.from = new Account(players[getRandomInt(0, players.length - 1)]);
    //} else {
    //    params.from = new Account(globalParams.accounts[getRandomInt(0, accounts.length - 1)]);
    //}

    params.from = globalParams.account;

    params.to = contract;
    params.gasPrice = Utils.toBigNumber(1000000);
    params.gasLimit = Utils.toBigNumber(2000000);
    params.value = Utils.toBigNumber(value * Math.pow(10, 18));

    // prepare contract
    params.contract = {
        "function": fun,
        "args": JSON.stringify(args)
    };

    neb.api.getAccountState(params.from.getAddressString()).then(function (resp) {
        params.nonce = parseInt(resp.nonce) + 1;
        callback(params);
    }).catch(function (err) {
        console.log(err);
    });
}


function innerDeploy(callback){

    let params = {};

    if (!globalParams.account) {
        return;
    }
    params.from = globalParams.account;
    params.to = params.from.getAddressString();
    params.gasPrice = Utils.toBigNumber(1000000);
    params.gasLimit = Utils.toBigNumber(2000000);
    params.value = 0;

    const fs = require('fs');
    var source = fs.readFileSync('/Users/taofeng/Github/fundplayerone/contracts/capitalgame.js', "utf-8");

    // prepare contract
    params.contract = {
        "source": source,
        "sourceType": 'js',
        "args": ''
    };

    neb.api.getAccountState(params.to).then(function (resp) {
        params.nonce = parseInt(resp.nonce) + 1;
        callback(params);
    }).catch(function (err) {
        console.log(err);
    });


}